import React from 'react'
import "./home.css"

const Home = () => {
    return (
        <>
            <div className='home-component'>
                <header className='menu'>
                    <p>[myname]</p><p>[opition]</p>
                </header>
                <section>
                    redes sociais
                </section>
            </div>
        </>
    );
}

export default Home;
